import React, { Component } from 'react'
import styles from './../../modules/Categories.module.css'
class Categories extends Component {
  render() {
    return (
      <div className={styles.categoriesContainer}>
        <p id={styles.Categories}>Explore Categories</p>
        <div className={styles.categoriesSideMenu}>
          <p>
            EdYoda is free learning and knowledge sharing platform for techies
          </p>
          <button>Go to main Website</button>
        </div>
      </div>
    )
  }
}

export default Categories
